  false,\n\t\"url\": null,\n\t\"notes\": \"In the summer of 2008, the Northwest Florida
  Water Management District collected lidar data over a portion of Walton County,
  FL (Eglin Air force Base) to support various projects such as floodplain and hazards
  mapping, wetlands mitigation and stormwater management. The data collection occured
  in a portion of the county for which there is no prior collected lidar data. Used
  in conjunction with previously collected data in Walton County (FDEM Lidar collected
  in 2006), these data support the creation of a county-wide, high resolution, lidar
  derived digital elevation model(DEM).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
